import React from "react";
import { List } from "./../components/List";
import "./../styles/article.css";
import { Headline } from "./../components/Headline";

export function Article() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-4 scrollbar_list" style={{ padding: 10 }}>
          <div className="row">
            <div className="col-md-6">
              <span style={{ fontWeight: "700" }}>Berita terkini</span>
            </div>
            <div className="col-md-6">
              <p style={{ color: "#f47522", fontSize: 12, textAlign: "right" }}>
                Lihat semua
              </p>
            </div>
          </div>
          <List />
        </div>
        <div
          className="col-md-8 align-items-center"
          style={{ backgroundColor: "white" }}
        >
          <img
            src="https://assets.change.org/photos/8/vd/py/lFVdPYCyAItZJKJ-800x450-noPad.jpg"
            style={{
              width: 600,
              alignSelf: "center",
              padding: 15
            }}
          />
        </div>
      </div>
    </div>
  );
}
